def test_http_multiple_success_cases(clear_data_http):
    payload_register = {
        "email": "valid@gmail.com",
        "password": "abcdef",
        "name_first": "Vikram",
        "name_last": "Sundar"
    }
    response_register = requests.post(
        f"{url}auth/register/v2", json=payload_register).json()

    payload_create_channel = {
        "token": response_register.get('token'),
        "name": "coolkidsclub",
        "is_public": True
    }
    requests.post(f"{url}channels/create/v2", json=payload_create_channel)

    message_payload = {
        "token": response_register.get('token'),
        "channel_id": 0,
        "message": "Hello!"
    }
    response_user = requests.post(
        f"{url}message/send/v1", json=message_payload).json()

    message_payload2 = {
        "token": response_register.get('token'),
        "channel_id": 0,
        "message": "This is my second message!"
    }
    requests.post(f"{url}message/send/v1", json=message_payload2).json()

    messages_payload = {
        "token": response_register.get('token'),
        "channel_id": 0,
        "start": 0
    }
    response_user = requests.get(
        f"{url}channel/messages/v2", params=messages_payload).json()

    assert response_user['messages'][0].get("message_id") == 1
    assert response_user['messages'][0].get("u_id") == 0
    assert response_user['messages'][0].get("message") == "This is my second message!"

    assert response_user['messages'][1].get("message_id") == 0
    assert response_user['messages'][1].get("u_id") == 0
    assert response_user['messages'][1].get("message") == "Hello!"


